import { 
   SearchContainer, 
   SearchInput,
   SearchIcon,
   SearchIconContainer
} from './SearchBar.styles'
export default function SearchBar(props) {
   return (
      <SearchContainer>
         <SearchInput type='search'/>
         <SearchIconContainer>
            <SearchIcon onClick={props.onSearch}/>
         </SearchIconContainer>
      </SearchContainer>
   );
}
